const ScreenShot = ({src, alt, caption}) => {
    print(`rendering screenShot ${src}`);
    return (
        <div>
            <img
                src={src}
                alt={alt}
            />
            <p>{caption}</p>
        </div>
    )
};

export default ScreenShot;
